Na een afwezigheid van 20 jaar, keert Ned Kendall tegen zijn zin terug naar zijn geboorteplek, omdat zijn vader, waar hij nooit goed mee overweg kon, op sterven ligt. Ned heeft zijn 21-jarige mooie vriendin Toni meegenomen als afleiding en om zijn vader nog een beetje te pesten. Maar helaas, wat Ned probeerde te voorkomen gebeurt toch, vele herinneringen uit zijn pijnlijke jonge jaren komen naar boven.

